// SPDX-License-Identifier: UNLICENSED

// DO NOT MODIFY BELOW THIS
pragma solidity ^0.8.17;

import "hardhat/console.sol";

contract Splitwise {
    // DO NOT MODIFY ABOVE THIS

    // ADD YOUR CONTRACT CODE BELOW
    mapping(address => mapping(address => uint256)) public ious;

    // Returns the amount that the debtor owes the creditor
    function lookup(
        address debtor,
        address creditor
    ) public view returns (uint256) {
        return ious[debtor][creditor];
    }

    function subtract_debts(address[] memory addresses, uint32 min) public {
        require(addresses.length > 1, "Need at least two addresses for a cycle");
        for (uint i = 0; i < addresses.length - 1; i++) {
            uint256 currentDebt = ious[addresses[i]][addresses[i + 1]];
            require(currentDebt >= min, "Cannot subtract more than the owed amount");
            ious[addresses[i]][addresses[i + 1]] -= min;
        }
    }

    function add_IOU(
        address creditor,
        uint32 amount
    ) public {
        require(creditor != msg.sender, "Cannot owe to oneself");
        require(amount > 0, "IOU amount must be positive");

        // Check for potential overflow
        uint256 existingDebt = ious[msg.sender][creditor];
        require(existingDebt + amount > existingDebt, "Addition overflow");

        ious[msg.sender][creditor] += amount;
    }
}

